import React from 'react';
import {Col, Panel, Row} from 'rsuite';
import AreaChart from './AreaChart';
import BarChart from './BarChart';
import RadarChart from './RadarChart';

export type CardSection3Props={
  RadarData?:any
  PieDonutChartData?:any
  BarChartData?:any
  tinyBarChartData?:any
  AreaChartData?:any
  BarChartData?:any
  RadarChartData?:any
}


const Card = props => (
  <Panel {...props} bordered shaded  bodyFill style={{width:'80%', backgroundColor:"white" , margin:"30px",marginLeft:"40px"}}>

  </Panel>
);

const CardSection3 = (props: CardSection3Props)=>{
  console.log("done")
return (
  <Row>
      {props?.RadarChartData ?
    <Col md={props?.RadarChartData?.md} sm={props?.RadarChartData.sm}>
      <Card  ><div style={{height:"500px"}}>
  <RadarChart RadarChartData={props?.RadarChartData}/>

        </div></Card>
    </Col> : null }
    {props?.AreaChartData ?
    <Col md={8} sm={12}>
      <Card ><div style={{height:"500px"}}>
      <AreaChart
      AreaChartData={props?.AreaChartData}/>
        </div></Card>
    </Col> : null }

    {props?.BarChartData ?
    <Col md={8} sm={12}>
      <Card ><div style={{height:"500px"}}>
        <BarChart
        BarChartData={props?.BarChartData}
        />


        </div>
        </Card>
    </Col> : null }

  </Row>
);
}

export default CardSection3;
